  return (
    <div>
      <Nav></Nav>
      <Route path='/qutes'>
        <QuoteList></QuoteList>
      </Route>
      <Route path='/qute'>
        <QuoteForm></QuoteForm>
      </Route>
    </div>
  );
}

export default App;
